  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Hawaii's ALOHA (\"A Long-term
  Oligotrophic Habitat Assessment\") Cabled Observatory (ACO) is located 100 km north
  of the island of Oahu, Hawaii (22 45'N, 158W) in the North Pacific Ocean. It provides
  real-time oceanographic observations from a depth of about 4,800 m via a submarine
  fiber optic cable that comes ashore at Makaha on Oahu. This data set provides measurements
  of sea water temperature at the ACO at 1.83 m above the ocean bottom.\",\n\t\"owner_org\":
